   "source": [
    "**Some compelling insights revealed in this summary:**\n",
    "\n",
    "* The average sedentary time is 991 minutes or about 16 hours. It's definitely too long and needs to be reduced!\n",
    "\n",
    "* Most of the participants engage in light activity.\n",
