    "* On the average, participants sleep 1 time for 7 hours.\n",
    "\n",
    "\n",
    "* The average daily step count is 7,638, slightly below the recommended threshold for health benefits according to CDC research. They found that taking 8,000 steps per day was linked to a 51% lower risk of all-cause mortality, while taking 12,000 steps per day was associated with a 65% lower risk compared to taking 4,000 steps.\n",
